import React from "react";
import "./Profile.css";
import Data from "../Data/Data";

const Profile = () => {
    const profileData = Data[0].profile["basic-info"];
    const basicInfoHeaders = profileData["basic-info-headers"];

    return (
        <div className="profile">
            <h2>Profile</h2>
            <div className="profile-content">
                <div className="profile-basic-info">
                    <div className="parent">
                    {basicInfoHeaders.map((header, index) => (
                        <div key={index} className={`div${index + 1}`}>
                            <span>{profileData[header]}</span>
                        </div>
                    ))}
                    </div>
                </div>
                <div className="profile-img">
                    <img src="https://picsum.photos/300" alt="Resim Açıklaması" />
                </div>
                <div className="profile-about-me">
                    <h2>About Me</h2>
                    <span>
                        Lorem Ipsum is simply dummy text of the printing and
                        typesetting industry. Lorem Ipsum has been the industry's
                        standard dummy text ever since the 1500s, when an unknown
                        printer took a galley of type and scrambled it to make a
                        type specimen book.
                    </span>
                </div>
            </div>
        </div>
    );
};

export default Profile;
